import React from "react";
import Tile from "../tile/Tile";

export const TileList = ({ tiles }) => {
  return (
    <div>
      {tiles && tiles?.map((tile, index) => ( // check if tiles exists before using map
        <Tile key={index} {...tile} /> // Changed 'item.name' to 'tile.name' to access the correct property
      ))}
    </div>
  );
};
